import React, { Component } from 'react';
import "./HomePage.css"
class HomePage extends Component {
    render(){
        return(
            <div id="body">
                <h1>Hello! My name is Karen :)</h1>
                <p>welcome to my portoflio</p>
            </div>
        )
    }
}

export default HomePage
